DECLARE @AverageSalaryLowerThreshold INT = 8000,         @AverageSalaryUpperThreshold INT = 9000;          SELECT a.id AS "Account ID" FROM (SELECT p.id AS person_id,                   r.addressid AS address_id,                    AVG(r.income) AS avg_income            FROM person p            INNER JOIN residents r ON p.addressid = r.addressid            GROUP BY p.id, r.addressid            HAVING AVG(r.income) BETWEEN @AverageSalaryLowerThreshold AND @Average_salary_upper_threshold) as incomeFilteredPersons              INNER JOIN account a ON (incomeFilteredPersons.person_id = a.person_id) WHERE a.type != 'OWNER' ORDER BY Account;	financial
