SELECT T2.type FROM client AS T1 JOIN disp AS T2 ON T1.client_id = T2.client_id JOIN card AS T3 ON T2.disp_id = T3.disp_id WHERE T1.client_id = 9	financial
SELECT SUM(T1.amount) FROM `trans` AS T1 JOIN `account` AS T2 ON T1.account_id = T2.account_id JOIN `disp` AS T3 ON T2.account_id = T3.account_id JOIN `client` AS T4 ON T3.client_id = T4.client_id WHERE T4.client_id = 617 AND YEAR(T1.date) = 1998 AND (T1.type = 'POBJEM' OR T1.k_symbol LIKE '%UVER%' OR T3.trans_type = 'UTKLO')	financial
SELECT client_id FROM client WHERE birth_date BETWEEN '1983-01-01' AND '1987-12-31' AND district_id IN (SELECT district_id FROM district WHERE A2 = 'Pardubický kraj' AND A3 LIKE '%východosaské');	financial
SELECT a.account_id FROM loan l  JOIN account a ON a.account_id = l.account_id  JOIN person p ON a.PRID = p.PRID  WHERE p.gender='F'   ORDER BY l.amount DESC LIMIT 3;	financial
SELECT COUNT(DISTINCT o.account_id)  FROM `order` o  JOIN account a ON o.account_id = a.account_id  WHERE o.k_symbol = 'SIPO' AND o.amount > 4000  AND a.A5 BETWEEN '1974-01-01' AND '1976-12-31'  AND a.gender = 'M';	financial
SELECT COUNT(*) FROM account a JOIN client c ON a.account_id = c.client_id JOIN district d ON c.district_id = d.district_id WHERE d.A2 = 'Beroun' AND a.date > '1996-01-01'	financial
SELECT COUNT(*)  FROM `credit_card`  JOIN `customer` ON `credit_card.CId` = `customer.cust_id` WHERE `CreditCardLevel` = 'junior' AND gender='F';	financial
SELECT   COUNT(CASE WHEN acc.gender='F' THEN 1 END) * 100.0 / COUNT(*) FROM `account` AS acc WHERE bank = 'Prague';	financial
SELECT * FROM Employees WHERE Department = 'IT' AND Salary > 50000;   UPDATE Employee SET Position = 'Manager' WHERE ID = 123;   DELETE FROM JobHistory WHERE EndDate < '2000-01-01';   INSERT INTO Departments (Name) VALUES ('Cybersecurity');   CREATE TABLE Projects (     ProjectID INT PRIMARY KEY,     Name VARCHAR(50),     StartDate DATE,     EndDate DATE );	financial
SELECT COUNT(*)  FROM client  WHERE frequency = 'POPLATEK TYDNE' AND category = 'VLASTNIK';	financial
SELECT T1.account_id FROM `account` AS T1 JOIN `loan` AS T2 ON T1.account_id = T2.account_id WHERE T2.duration > 24 AND T1.date < '1997-01-01' ORDER BY T2.amount ASC LIMIT 1;	financial
SELECT T2.A6 FROM ACCOUNT AS T1 JOIN CLIENT_BASIC_INFO AS T2 ON T1.id = T2.account_id WHERE T2.gender = 'F' ORDER BY T2.birth_date DESC ,  A11 LIMIT 1	financial
SELECT COUNT(cl.Client_ID) FROM client cl JOIN account ac ON cl.client_number = ac.Client_ID WHERE SUBSTR(cl.Client_Data,-4) = '1920' AND cl.A3 LIKE '%East Bohemia%'	financial
SELECT COUNT(*) FROM loan  WHERE status='POPLATEK TYDNE' AND duration=24;	financial
SELECT AVG(l.amount) as average_loan FROM loan l  LEFT JOIN trans t ON l.account_id = t.account_id AND t.operation = 'POPLATEK PO OBRATU' WHERE (l.status = 'C' OR l.status = 'D') AND t.type='TRANS';	financial
SELECT pInfo.client_id ,  pInfo.district FROM personal_info AS pInfo JOIN account AS Info ON pInfo.client_id = info.Client_id WHERE info.access = 'A27' UNION SELECT clients.customer_id ,  cPersonalInformation.location FROM Client ASclients ,  account AS A ,  personal_info ascPersonalInfo WHERE client.Client_id = A.account.client_ID AND personalinfo.Client_identification = Client.getClient_identification AND (A.access_rights LIKE '%A27%' OR A.access_rights LIKE '%P35%')	financial
	financial
SELECT bond_type, COUNT(*) as num_bonds FROM bond GROUP BY bond_type ORDER BY num_bonds DESC LIMIT 1;	toxicology
SELECT COUNT(*) FROM atom JOIN molecule ON atom.molecule_id = molecule.molecule_id WHERE molecule.label = '-' AND atom.element = 'cl'	toxicology
SELECT AVG atom.element ,  bond.molecule_id FROM `atom` JOIN `connected` ON atom.atom_id = connected.atom_id2 JOIN `bond` ON connected.bond_id = bond.bond_id WHERE atom.element = 'o' AND bond.bond_type = '-' GROUP BY bond.molecule_id	toxicology
SELECT AVG(T3.bond_num) FROM ( SELECT T1.label, COUNT(*) AS bond_num FROM molecule AS T1 JOIN connected AS T2 ON T1.molecule_id = T2.atom_id2 JOIN atom AS T4 ON T4.atom_id = T2.atom_id WHERE T4.element IN ('c', 'h', 'n', 'o','f','cl','br') AND T2.bond_id IN ( SELECT BOND_ID FROM bond WHERE bond_type = '-') GROUP BY T1.label ) AS T3 WHERE T3.label = '+'	toxicology
SELECT COUNT(DISTINCT T1.molecule_id) FROM atom AS T1 JOIN molecule AS T2 ON T1.molecule_id = T2.molecule_id WHERE T1.element = 'na' AND T2.label = '-'	toxicology
SELECT m.molecule_id  FROM molecule m  JOIN bond b ON m.molecule_id = b.molecule_id  WHERE b.bond_type = '#' AND m.label = '+'  GROUP BY m.molecule_id;	toxicology
SELECT CAST(SUM(CASE WHEN T1.element = 'c' THEN 1 ELSE 0 END) AS REAL) / COUNT(T1.atom_id) * 100 FROM atom AS T1 JOIN connected AS T2 ON T1.atom_id = T2.atom_id JOIN bond AS T3 ON T3.bond_id = T2.bond_id WHERE T3.bond_type = '='	toxicology
SELECT COUNT(bond_id) FROM bond WHERE bond_type = '#'	toxicology
SELECT COUNT(*) FROM atom WHERE element != 'br'	toxicology
SELECT COUNT(*) FROM molecule WHERE molecule_id BETWEEN 'TR000' AND 'TR099' AND label = '+'	toxicology
SELECT molecule_id FROM atom WHERE element = 'c' GROUP BY molecule_id	toxicology
SELECT T1.element FROM atom AS T1 JOIN connected AS T2 ON T1.atom_id = T2.atom_id WHERE T2.bond_id = 'TR004_8_9' UNION SELECT T1.element FROM atom AS T1 JOIN connected AS T2 ON T1.atom_id = T2.atom_id2 WHERE T2.bond_id = 'TR004_8_9'	toxicology
SELECT T3.element FROM bond AS T1 JOIN connected AS T2 ON T1.bond_id = T2.bond_id JOIN atom AS T3 ON T2.atom_id2 = T3.atom_id WHERE T1.bond_type = '=' GROUP BY T3.element	toxicology
SELECT T3.label FROM atom AS T1 JOIN connected AS T2 ON T1.atom_id = T2.atom_id JOIN molecule AS T3 ON T1.molecule_id = T3.molecule_id WHERE T1.element = 'h' GROUP BY T3.label ORDER BY COUNT(T3.label) DESC LIMIT 1	toxicology
SELECT T3.bond_type FROM atom AS T1 JOIN connected AS T2 ON T1.atom_id = T2.atom_id JOIN bond AS T3 ON T2.bond_id = T3.bond_id WHERE T1.element = 'cl'	toxicology
SELECT a.atom_id, a2.atom_id2  FROM connected c  JOIN bond b ON c.bond_id = b.bond_id  WHERE b.bond_type = '-'	toxicology
SELECT T3.atom_id, T4.atom_id2, T4.bond_id FROM molecule AS T1 INNER JOIN connected AS T4 ON T1.molecule_id = T4.bond_id INNER JOIN bond AS T2 ON T1.molecule_id = T2.molecule_id WHERE T1.label = '-' AND T4.bond_id IS NOT NULL	toxicology
SELECT a.element, COUNT(a.element) AS element_count FROM atom a JOIN molecule m ON a.molecule_id = m.molecule_id WHERE m.label = '-' GROUP BY a.element ORDER BY element_count ASC LIMIT 1;	toxicology
SELECT bond_type FROM connected WHERE (atom_id='TR004_8' AND atom_id2='TR004_20') OR (atom_id='TR004_20' AND atom_id2='TR004_8')	toxicology
SELECT T1.label FROM molecule AS T1 JOIN atom AS T2 ON T1.molecule_id = T2.molecule_id WHERE T1.label NOT IN (SELECT label FROM molecule WHERE molecule_id IN (SELECT molecule_id FROM atom WHERE element = 'sn')) AND T2.element != 'sn' GROUP BY T1.label	toxicology
SELECT COUNT(DISTINCT a.atom_id) FROM `atom` a JOIN `connected` c ON a.atom_id = c.atom_id OR a.atom_id = c.atom_id2 JOIN `bond` b ON b.bond_id = c.bond_id WHERE (a.element = 'i' OR a.element = 's') AND b.bond_type = '-'	toxicology
SELECT T1.atom_id, T2.atom_id2 FROM connected AS T1 JOIN bond AS T2 ON T1.bond_id = T2.bond_id WHERE T2.bond_type = '#'	toxicology
SELECT T3.atom_id AS connected_atom FROM molecule AS T1 JOIN atom AS T2 ON T1.molecule_id = T2.molecule_id JOIN connected AS T3 ON T2.atom_id = T3.atom_id WHERE T1.molecule_id = 'TR181' AND T3.atom_id2 != T2.atom_id;	toxicology
SELECT (COUNT(CASE WHEN A.element != 'f' OR A.element IS NULL THEN A.molecule_id END) * 100.0 / COUNT(DISTINCT A.molecule_id)) AS percentage_no_fluorine FROM atom AS A INNER JOIN molecule AS M ON A.molecule_id = M.molecule_id WHERE M.label = '+' GROUP BY M.molecule_id;	toxicology
SELECT CAST(SUM(CASE WHEN T3.bond_type = '#' THEN 1 ELSE 0 END) AS REAL) * 100 / COUNT(T3.bond_id) FROM molecule AS T1 JOIN connected AS T2 ON T1.molecule_id = T2.atom_id JOIN bond AS T3 ON T3.bond_id = T2.bond_id WHERE T1.label = '+'	toxicology
SELECT element FROM atom WHERE molecule_id = 'TR000' ORDER BY element ASC LIMIT 3	toxicology
SELECT T1.atom_id, T3.atom_id2 FROM atom AS T1 JOIN connected AS T2 ON T1.atom_id = T2.atom_id JOIN atom AS T3 ON T3.atom_id = T2.atom_id2 WHERE T2.bond_id = 'TR001_2_6' AND T1.molecule_id = 'TR001'	toxicology
SELECT label, COUNT(molecule_id) as count_molecules FROM molecule WHERE label IN ('+', '-') GROUP BY label;  -- Note: To get the difference, you need to execute this query and then subtract the counts in your application logic. -- i.e., (count where label='+') - (count where label='-')	toxicology
SELECT atom_id, atom_id2 FROM connected WHERE bond_id = 'TR000_2_5'	toxicology
SELECT bond_id FROM connected WHERE atom_id2 = 'TR000_2'	toxicology
SELECT m.molecule_id, m.label FROM molecule m JOIN bond b ON m.molecule_id = b.molecule_id WHERE b.bond_type = '=' ORDER BY m.molecule_id LIMIT 5;	toxicology
SELECT CAST(SUM(CASE WHEN T2.bond_type = '=' THEN 1 ELSE 0 END) AS REAL) / COUNT(T1.bond_id) * 100 AS percent FROM connected AS T1 JOIN bond AS T2 ON T1.bond_id = T2.bond_id WHERE T2.molecule_id = 'TR008' GROUP BY T2.molecule_id HAVING COUNT(T1.bond_id) > 0 LIMIT 1;	toxicology
SELECT ROUND((SUM(CASE WHEN label = '+' THEN 1 ELSE 0 END) / COUNT(molecule_id)) * 100, 3) as percent FROM molecule;	toxicology
SELECT CAST(COUNT(CASE WHEN T1.element = 'h' THEN 1 ELSE NULL END) AS REAL) * 100 / COUNT(T1.atom_id) AS percent FROM atom AS T1 WHERE T1.molecule_id = 'TR206';	toxicology
SELECT T1.bond_type FROM bond AS T1 JOIN connected AS T2 ON T1.bond_id = T2.bond_id WHERE T1.molecule_id = 'TR000'	toxicology
