-- Set up relationship schema: Card with its corresponding set (using set_card association table - hypothetical) CREATE TABLE card  (id INTEGER PRIMARY KEY, uuid TEXT NOT NULL UNIQUE);  CREATE TABLE `sets` (  id SERIAL,  `name` text not null,  -- for simplicity I defined name but it doesn't necessarily matter here     `code` varchar(5),      -- set codes like for 'Abyssal Horror'- assume a setCode of unique value instead     foreign key (`uuid`, `setUuid`) refernces (cards.id, setsId));    -- Define SQL: ---- For better readability, this uses joins for clarity & flexibility; you want to check join method is optimal.  WITH cardSet AS      (    select * from (select c.uuid, s.code, SETname=s.name as Set FROM cards c     INNER JOIN set_card   USING (`uuid`)        CROSS APPLY sets    s ON setUuid=sets.id       where c.convertedManaCost =10 AND cSet.name ='Abyssal Horror') t ) SELECT round(sum(c.CardNum) * 1.0 /               sum(case when Set is not null then CardNum::text end))||'%',         set_name  FROM card_set  cs where SETNAME like'%abyss% Horror' group by set;  -- Alternatively:     SELECT (COUNT(cc.conveRtedmanacost)::REAL/Scc.TotalCard)*100 as %       FROM set sc1           CROSS APPLY SELECT sc.id, (SELECT COUNT(uuid) totalcard) --Get total number from cards table for current set name) FROM sets where name= 'abyss horror'; -- OR  just  :     SELECT    CAST(    sUM(CASE           WHEN convertedManaCost = CASE WHEN setName LIKE '%Abyssal Horror' THEN 10            END)*1.0/count(`cards`)    end) AS pct_convertmanacosteqten     from cards c         LEFT join set s ON s.setName="DOM" ---just example  , actual depends on  SET CODE  and not NAME (SUGGEST using this )	card_games
