WITH CardSubset AS (   SELECT DISTINCT c.artist, c.setName, st.name as format_name, c.types, c.watermark   FROM cards c   JOIN set_translations st ON c.setCode = st.setCode   WHERE c.border = 'black' ), FinalCards AS (   SELECT cs.*, s.isForForeignOnly, s.isForOnlineOnly, st.translation as name_zh   FROM CardSubset cs   JOIN Sets s ON cs.setName = s.name   JOIN set_translations st ON cs.setCode = st.setCode AND st.language='Chinese Simplified' ) SELECT COUNT(DISTINCT(c.artist))  FROM cards c  WHERE uuid IN (   SELECT card_id    FROM FinalCards );	card_games
