SELECT AVG(t.total_price)  FROM transactions_1k t JOIN gasstations g ON t.gas_station_id = g.GasStationID WHERE g.Country = 'CZE'	card_games
SELECT AVG(total_price)  FROM (  SELECT t.TransactionID, SUM(t.Spend) as total_price  FROM transactions_1k t  JOIN customers c ON t.CustomerID = c.CustomerID  WHERE c.Currency = 'EUR'  GROUP BY t.TransactionID) AS grouped_transactions;	card_games
