SELECT ((SELECT SUM(t1.Amount) FROM transactions_1k AS t1 WHERE t1.CustomerID IN(SELECT CustomerID FROM yearmonth WHERE strftime('%Y', Date) = '2012') AND t1.Date = '2012-08-24' AND t1.Price * t1.Amount = 634.8) - (SELECT SUM(t1.Amount) FROM transactions_1k AS t1 WHERE t1.CustomerID IN(SELECT CustomerID FROM yearmonth WHERE strftime('%Y', Date) = '2013') AND t1.Date = '2012-08-24' AND t1.Price * t1.Amount = 634.8)) / (SELECT SUM(t1.Amount) FROM transactions_1k AS t1 WHERE t1.CustomerID IN(SELECT CustomerID FROM yearmonth WHERE strftime('%Y', Date) = '2012') AND t1.Date = '2012-08-24' AND t1.Price * t1.Amount = 634.8) AS Consumption_Decrease_Rate;   However, it should be clarified the date range for getting the total consumption in year 2012 and 2013 as 'Date=2012-08-24 OR Price * Amount' are possibly not accurate based on question. I have used it as per given instruction. Correct SQL might require additional condition to get precise answer of this question.	card_games
