SELECT SUM(T3.Price * T3.Amount) AS TotalSpent  FROM customers AS T1  JOIN transactions_1k AS T3 ON T1.CustomerID = T3.CustomerID  WHERE T1.CustomerID = 38508 AND strftime('%Y%m', T3.Date) = '201201';   SELECT SUM(T3.Price * T3.Amount) FROM customers AS T1 JOIN transactions_1k AS T3 ON T1.CustomerID = T3.CustomerID WHERE T1.CustomerID = 38508;	card_games
